#nonsponsored Must Buy Makeup from @mynykaa Hot Pink Sale💕

@physiciansformula The Healthy Foundation is such a beautiful foundation. It has medium to buildable coverage & it has a satin finish which makes it perfect for everyday use. Also, it lasts super long & does not crease or cake up. 

@maybelline.india Age Rewind Concealer is my go to as it looks like second skin! It was actually the first concealer I bought with my own money a long time back and I’ve always repurchased it!

@trysugar Contour De Force Mini Blush is so pigmented & blends out like a dream. The peachy colour makes it super cute & it’s definitely a must have in everyones collection.

@forever52india Quickly Fix Setting Spray takes off any powderiness immediately & makes the skin look fresh & juicy. Also, it sets the makeup really well & makes it long lasting.

@thebalm Mary-Lou Manizer has been the OG highlighter since years & it still is in my top faves. It’s super blinding & makes the skin look so juicy. It never sits on top of the skin, but instead melts beautifully into it.
